function ks_strategy_firstCapital(){$(".breadcrumb ul li:last-child a").addClass("btn-disable").css("cursor","initial"),$(".breadcrumb ul li a").each(function(){$(this).text(firstCapital($(this).text()))})}function firstCapital(a){return a&&a[0].toUpperCase()+a.slice(1)}